import './SongItem.css'
function SongItem() {
    const expenseDate = new Date(2021,2,28);
    return (
        <div className="song">
            <div>song name</div>
            <div>artist</div>
            <div>album</div>
            <div>duration</div>
            <div>{ expenseDate }</div>
        </div>
    )
}

export default SongItem;
